  {
    path: "/",
    element: <App  value= {''}/>,
  },
  {
    path: "/Specs",
    element: <App  value= {'Specs'} mainRef={specsRef}/>,
  },
  {
    path: "/Case",
    element: <App value= {'Case'}/>,
  },
  {
    path: "/Products",
